import React from 'react';
import millify from 'millify';
import { Typography, Row, Col, Statistic } from 'antd';
import { Link } from 'react-router-dom';

const { Title } = Typography;

const Homepage = () => {
    return (
        <>
            <Title level={2} className="heading">Global Crypto Stats</Title>
            <Row>
                <Col col={12}><Statistic title="Total Cryptocurrencies" value="5"></Statistic></Col>
                <Col col={12}><Statistic title="Total Exchanges" value="5"></Statistic></Col>
                <Col col={12}><Statistic title="Total Martket Cap" value="5"></Statistic></Col>
                <Col col={12}><Statistic title="Total 24h Volume" value="5"></Statistic></Col>
                <Col col={12}><Statistic title="Total Total Markets" value="5"></Statistic></Col>
            </Row>
        </>
    )
}

export default Homepage
